import Typewriter from "typewriter-effect";

function App() {
  var app = document.getElementById("app");

  var typewriter = new Typewriter(app, {
    loop: true,
    delay: 75,
  });
  return (
    <div>
      <Typewriter
        onInit={(typewriter) => {
          typewriter.typeString("coming soon...").pause(2000).deleteAll.start();
        }}
      />
    </div>
  );
}

export default App;
